router.get("/getfile", async function (req, res) {
    res.setHeader('Access-Control-Allow-Origin', '*');
    function read() {
        return new Promise((resolve, rejects) => {
            fs.readFile('./public/word.docx', function (err, data) {
                //       ok
                resolve(data)
                rejects(err)
            })
        })
    }
    let data = await read();

    function toArrayBuffer(myBuf) {
        var myBuffer = new ArrayBuffer(myBuf.length);
        var res = new Uint8Array(myBuffer);
        for (var i = 0; i < myBuf.length; ++i) {
            res[i] = myBuf[i];
        }
        return myBuffer;
    }
    data = toArrayBuffer(data);
    console.log("...", data);
    res.send(data);
})


router.get("/readStream", async function (req, res) {
    var s = fs.createReadStream("./server/api/stream.txt");

    fs.readFile('./server/api/stream.txt', function (err, data) {
        if (err) {
            res.end({ code: -1, message: err.toString() });
        } else {
            res.type("text");
            res.write(data);
            res.end();
        }
    });
})

module.exports = router;
